import React from "react";

const Experience = ({ experience }) => {
    return (
    <li>
        <p>{experience.title} {experience.startTime} - {experience.endTime}
        <br></br>
        {experience.description} {experience.organization}</p>
    </li>
    )
}

export default Experience;
